import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import "../assets/component.css";
import Classroom from "./classroom";
import Menu from "./menu";

class NavBar extends Component {
	render() {
		return (
			<Router>
				<nav className="navbar navbar-success main-color">
					<h4 className="my-0 mr-md-auto font-weight-bold">Static</h4>
					<a className="p-2 text-dark">
						<Link to="/classroom">Leaderboard</Link>
					</a>
					<a className="p-2 text-dark" href="#">
						Achievements
					</a>
					<a className="p-2 text-dark" href="#">
						Settings
					</a>
					<a className="btn btn-warning font-weight-bold" href="#">
						Log out
					</a>
				</nav>
				<Switch>
					<Route path="/classroom" component={Classroom} />
				</Switch>
			</Router>
		);
	}
}

export default NavBar;
